import DefaultLayout from "../Layouts/DefaultLayout";

export default function Login() {
    return (
        <DefaultLayout>
            <div>
                
            </div>
            <form className="container ml-auto mr-auto p-3">
                <h1 className="py-2 text-lg text-black font-medium text-center">Login</h1>
                <div className="flex flex-col w-full">
                    <label className="ml-5 py-1 items-center text-neutral-500 font-normal text-sm transition-all duration-200 ease-in-out" htmlFor="email">Correo</label>
                    <input type="text" className="bg-transparent mb-3 px-5 py-3 w-full border border-neutral-300 rounded-xl outline-none text-sm text-black font-normal" name="email" placeholder="Introduzca su correo" />
                </div>
                <div className="flex flex-col w-full">
                    <label className="ml-5 py-1 items-center text-neutral-500 font-normal text-sm transition-all duration-200 ease-in-out" htmlFor="password">Contraseña</label>
                    <input type="password" className="bg-transparent mb-6 px-5 py-3 w-full border border-neutral-300 rounded-xl outline-none text-sm text-black font-normal" placeholder="Introduzca su contraseña" name="password" />
                </div>
                <button className="bg-gradient-to-r from-red-600 to-red-700 hover:from-red-700 hover:to-red-800 rounded-xl px-5 py-3 w-full text-base text-white font-medium">Iniciar Sesión</button>
            </form>;
        </DefaultLayout>
    );
}
